[application]

name="crash-clone"
main_scene="res://data/4godot/game.scn"
icon="res://data/4godot/icon.png"
boot_logo=img(rgba, 0, 189, 140, )
boot_bg_color=#ffffffff

[autoload]

sceneloader="res://data/4godot/sceneloader.gd"

[display]

width=800
height=480
stretch_mode="2d"

[image_loader]

filter=false
gen_mipmaps=false

[input]

ui_accept=[key(Return), key(Enter), key(Space), jbutton(0, 0)]
ui_cancel=[key(Escape), jbutton(0, 1)]
ui_left=[key(Left), jbutton(0, 14)]
ui_right=[key(Right), jbutton(0, 15)]
ui_up=[key(Up), jbutton(0, 12)]
ui_down=[key(Down), jbutton(0, 13)]
